function resetShareTable() {
  d3.selectAll('.shape').style('stroke','none');
  tableMaker(d3.select('.nation').datum());
  d3.select('#table-location').html('United States');

}


/* FUNCTION TO CLICK AND ZOOM */

function clicked(d) {

  var selected = d3.select('.state' + d.id);

  if (active.node() === selected.node()) return reset();
  active.classed('active', false);
  active = selected.classed('active', true);

  var bounds = path.bounds(d),
      dx = bounds[1][0] - bounds[0][0],
      dy = bounds[1][1] - bounds[0][1],
      x = (bounds[0][0] + bounds[1][0]) / 2,
      y = (bounds[0][1] + bounds[1][1]) / 2,
      scale = .9 / Math.max(dx / width, dy / height),
      translate = [width / 2 - scale * x, height / 2 - scale * y];

  g.transition()
      .duration(750)
      .attr('transform', 'translate(' + translate + ')scale(' + scale + ')');

  zoom = 1;

}

function reset() {
  active.classed('active', false);
  active = d3.select(null);

  g.transition()
      .duration(750)
      // .style('stroke-width', '1.5px')
      .attr('transform', '');

  zoom = 0;
  resetShareTable();

}

